"use strict";class BrowseDialog extends Dialog{constructor(n,t,i){super(n);this.parent=t;this.gridControl=i}show(){this.selectRow(this.parent.currentRow);this.open()}selectRow(n){const t=this.gridControl.selectedRow();if(n!=t.rowIndex){const t=$(this.gridControl.table()).find("tr").eq(n);this.gridControl.selectRow(t);t[0].scrollIntoView(!1)}}}